import React, { useEffect } from "react";

export default function Script() {
    useEffect(function mount() {
        const scripts = [
            fetch("https://d3e54v103j8qbb.cloudfront.net/js/jquery-3.5.1.min.dc5e7f18c8.js?site=5f8c3ce2a4a54e8ea6450cea").then(body => body.text()),
            fetch("../scripts/webflow.js").then(body => body.text()),
          ]
          try {
            scripts.concat(Promise.resolve()).reduce((loaded, loading) => {
              return loaded.then((script) => {
                new Function(`
                  with (this) {
                    eval(arguments[0])
                  }
                `).call(window, script)
        
                return loading
              })
            })
          } catch (error) {
            console.log(error)
            return true;
          }
  })
}
